import React, { Component } from 'react';
import './App.css';
import ReactSwipe from 'react-swipe';

class LandingPage extends Component {
  render() {
    let reactSwipeEl;
    return (
      <div>
        <div id="home" className="home">
          <div className="text-vcenter">
            {/*<h1>Hello World</h1>*/}
            {/*<h3>This is bootstrap-based layout</h3>*/}
            {/*<a href="#about" className="btn btn-default btn-lg">Continue</a>*/}
          </div>
        </div>
        <div className="container">
          <div className="text-center">
            <span className="highlights glacial-indifference">Our </span><span className="highlights kollektif">Collection</span>
          </div>
        </div>
        <ReactSwipe
          className="carousel"
          swipeOptions={{ continuous: false }}
          ref={el => (reactSwipeEl = el)}
        >
          <div className="card" style="width: 18rem;">
            <img className="card-img-top" src="" alt="Card image cap"/>
              <div className="card-body">
                <h5 className="card-title">Card title</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the
                  card's content.</p>
                <a href="#" className="btn btn-primary">Go somewhere</a>
              </div>
          </div>
          <div className="card" style="width: 18rem;">
            <img className="card-img-top" src="" alt="Card image cap"/>
              <div className="card-body">
                <h5 className="card-title">Card title</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the
                  card's content.</p>
                <a href="#" className="btn btn-primary">Go somewhere</a>
              </div>
          </div>
          <div>PANE 3</div>
        </ReactSwipe>
        <button onClick={() => reactSwipeEl.next()}>Next</button>
        <button onClick={() => reactSwipeEl.prev()}>Previous</button>
      </div>
    );
  }
}

export default LandingPage;
